import React,{useState} from 'react';
import {
    Form,
    FormGroup,
    Input,
    Label,
    Container,
    Button
}from 'reactstrap';

export const Forms =()=>{
    const [{name,contact},setState]=useState({name:'',contact:''});
    const onChange=(e)=>{
        setState([e.target.name]=e.target.value)
    }
    return(
        <Container>
            <Form>
                <FormGroup>
                    <Label>Name</Label>
                    <Input type="text" value={name} onChange={onChange} name="name" />
                </FormGroup>
                <FormGroup>
                    <Label>Contact</Label>
                    <Input type="text" value={contact} onChange={onChange} name="contact"/>
                </FormGroup>
            </Form>
        </Container>        
    )
}
